import "./Logsig.css";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React, { useState } from "react";
import sign from "./signin.png";
import axios from 'axios';
import { Link } from 'react-router-dom';

function Mainlogin()
{


      const [email, setEmail] = useState('');

      const [password, setPassword] = useState('');

      const handleSubmit = (event) => {
        event.preventDefault();

      };

      const sendData= async(email)=>{
axios.post("http://localhost:8000/signin",[ email  ])}

      return (
        <>
        <div>
        <form className="form"  method="post" onSubmit={handleSubmit}>
            <h1 className="header22">LOGIN</h1>
          <div className="flex-column">
            <label>Email ID</label>
          </div>
          <div className="inputForm">
            <input
             required
              placeholder="Enter your Email (clg Mail)"
              className="input"
              type="text"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div className="flex-column">
            <label>Password</label>
          </div>
          <div className="inputForm">
            <input
             required
              placeholder="Enter your Password"
              className="input"
              type="text"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
          <button onClick={()=>{
            sendData(email);
          }}  type="button"  className="button-submit">
           Login
          </button>

          <div className="login">
            <p>If not  existing user  <Link to="/Mainsignin"><span>SignUp</span></Link></p>
          </div>
        </form>
        </div>



      </>);
 }




export default Mainlogin;
